// src/Swift.js
import React from 'react';

const Swift = () => {
  return (
    <div className="container mx-auto max-w-sm">
      <h1 className="text-3xl font-semibold mb-4">Welcome to Swift Store</h1>
      <p>This is the Swift Store page.</p>
    </div>
  );
};

export default Swift;
